var videoApi = ()=>{
  fetch("ign-apis.herokuapp.com/",{
    'Access-Control-Allow-Origin':  'http://localhost:3000'
  })
  .then((res)=>res.json())
  .then((data)=>console.log(data))
};

export default videoApi;
